def countSubIslands(grid1, grid2):
        """
        :type grid1: List[List[int]]
        :type grid2: List[List[int]]
        :rtype: int
        """
        def numislands(grid):
            search_space = {}
            islands = []
            for i in range(len(grid)):
                for j in range(len(grid[0])):
                    if grid[i][j] == 1:
                        search_space[(i, j)] = True
            while (len(search_space) > 0):
                (i, j) = search_space.popitem()[0]
                stack = [(i, j)]
                island = set()
                while (len(stack)>0):
                    elt = stack.pop(-1)
                    island.add(elt)
                    neighbours = []
                    if elt[0] > 0: neighbours.append((elt[0] - 1, elt[1]))
                    if elt[0] < len(grid) - 1: neighbours.append((elt[0] + 1, elt[1]))
                    if elt[1] > 0: left = neighbours.append((elt[0], elt[1] - 1))
                    if elt[1] < len(grid[0]) - 1: left = neighbours.append((elt[0], elt[1] + 1))
                    for neighbour in neighbours:
                        if neighbour in search_space:
                            stack.append(neighbour)
                            search_space.pop(neighbour)
                islands.append(island)
            return islands
        islands = numislands(grid1)
        islands2 = numislands(grid2)
#        print(len(islands), len(islands2))
#        print('islands1', islands)
#        print('islands2', islands2)
#        print('\n')
        subislands = 0
        for i in islands:
            for j in islands2:
                if j.issubset(i):
                    subislands += 1
                    break
        return subislands


